window.addEventListener("load",()=>{const a=document.getElementById("wf-form-Log-in-form");a.addEventListener("submit",()=>{const a=setInterval(async()=>{try{const b=await window.MemberStack.onReady;if(b.loggedIn){const b=await fetch("https://tweetnet-backend.herokuapp.com/api/auth/authorize"),c=await b.json();if(c.status)clearInterval(a),window.location.href=c.data;else throw new Error(c.message)}}catch(a){console.error(a)}},1e3)})});